import logo from '../../assets/images/logo.svg'
import './login.scss'
import Typography from "@mui/material/Typography";
import CustomInput from './CustomInput.js'
import Box from "@mui/material/Box";
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';

export const Login = () => {
    return (
        <Box sx={{width: '31.25vw', height: '31.25vw', background: 'white', borderRadius: 'calc(0.1em + 1vw)'}}>
            <img className="logo_image" src={logo}></img>
            <Typography align="center" sx={{position: 'relative', mt:"10%"}}>Log into your account, or sign up here!</Typography>
            <div className="login_input">
                <CustomInput text="Username"/>
            </div>
            <div className="login_input">
                <CustomInput text="Password"/>
            </div>
            <Grid>

            </Grid>
        </Box>
    )
}
